import "../styles/welcome.css"
import { plot } from "plotly.js";
import { Card, Container, Button, Col, Row } from "react-bootstrap";
import home_img from "../statics/imgs/home_scrn.jpg"

const Welcome = () => {
    return (
        <Container>
            <div className="welc-div d-flex justify-items-center">
                <Row>
                <div className="p-2 d-flex justify-items-center">
                    <Row>
                        
                    <h1 className="text-secondary">Get a wider angle on coderhub.sa</h1>
                    <div>
                        
                    <h5 className="text-secondary w-75">Explore coderhub.sa leaderboard data in a better way and gain more insights</h5>
                    </div>
                    </Row>
                </div>
                <div>
                    
                <img className="shadow-lg" src={home_img} ></img>
                </div>
                </Row>
        </div>
        </Container>
    );
}

export default Welcome;
